package jichu;

public class ZeroOneString {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int a=0;a<2;a++)
			for(int b=0;b<2;b++)
				for(int c=0;c<2;c++)
					for(int d=0;d<2;d++)
						for(int e=0;e<2;e++){
							System.out.print(a);
							System.out.print(b);
							System.out.print(c);
							System.out.print(d);
							System.out.print(e);
							System.out.println();
						}
	}

}
